description:
Chị Minh mua nhà to hơn ở KĐT Starlake Daewoo, nhà Lạc Long Quân không ở nên bán, tặng hết nội thất cho chủ mới;
Ngõ trước nhà mình hai ô tô tránh, thông ra Võ Chí Công, hồ Tây, tiện ích xung quanh không thiếu thứ gì bao gồm trường học c1, c2 Đông Thái, mầm non, chợ...;
Nhà mình thoáng trước sau do sau nhà có 20m lưu không, thiết kế nhà có thể lắp thêm thang máy, nhà mới xây chưa đến 2 năm, mọi thứ coi như mới;
Pháp lý chuẩn, giao dịch ngay, có gia lộc cho khách thiện chí.
